import './App.css';
import React,{useState,useEffect} from 'react';
import GrassGrid from './GrassGrid/GrassGrid';
import Movement from './Movement/Movement';

function App() {
  return (
    <div>
      <div className="App">
        <header className="App-header">
            <Movement></Movement>
            <GrassGrid></GrassGrid>
        </header>
      </div>
    </div>
  );
}

export default App;
